import React from "react";

import './css/Thanks.css';
import { BiLaptop, BiLayer } from "react-icons/bi";

class Thanks extends React.Component {

  render() {

    const iconsColor = '#49a572';
    const iconsSize = '30px';

    return(
      <div className='WideSection'>
        <div className="Services-Container">
          <div>
            <p>
              <BiLaptop color={iconsColor} size={iconsSize}/>
            </p>
            <p>
              <strong className='Titles'>development</strong>
            </p>
            <p>
              Lorem ipsum dolor sit amet, consectetuer adipiscing elit. Donec quis nibh at felis congue commodo. 
            </p>
          </div>
          <div>
            <p>
              <BiLayer color={iconsColor} size={iconsSize}/>
            </p>
            <p>
              <strong className='Titles'>data base</strong>
            </p>
            <p>
              Lorem ipsum dolor sit amet, consectetuer adipiscing elit. Donec quis nibh at felis congue commodo. 
            </p>
          </div>
        </div>
        <div className="TitleMiddle">
          <strong className="Titles MainTitle">Thank for your time...</strong>
        </div>
      </div>
    );
  }
}

export default Thanks;
